import React from "react";
import Card from "./Card";

function CardExpenses(props) {
    const expenses =
        {
          id: "e1",
          name: "Paper",
          cost: 94.12,
          date: new Date(2020, 7, 14),
        }
return (
    <div>
<Card
    date= {props.card[0].date}
    name= {props.card[0].title}
    cost= {props.card[0].amount}
/>
<Card
    date= {props.card[1].date}
    name= {props.card[1].title}
    cost= {props.card[1].amount}
/>
<Card
    date= {props.expenses[0].date}
    name= {props.expenses[0].name}
    cost= {props.expenses[0].cost}
/>
</div>
);
}

export default CardExpenses;
